import React from "react";
import GraphComponent from "./GraphComponent";
import defaultImage from "../Assets/testImage.jpg"

export default class HomePage extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        return(
            <div className="mainContent">
                <div className="topBar">
                    <div className="bpmButton topBarButton">BeatzPM</div>
                    <div className="pageHeader"><span className="heart">H3art</span>Beatz</div>
                    <div className="invertedButton topBarButton">BPMShift</div>
                </div>
                <div className="albumContainer">
                    <img className="albumCover" src={defaultImage} alt={defaultImage}></img>
                </div>
                <GraphComponent/>
            </div>
        );
    }
}
